import React from 'react';
import './App.css';
import image from './A.png'
import transition from './static/transitions/AtoB.gif'

function App() {
  console.log(image)

  return (
    <div className="App">
      <header className="App-header">
        <img src={transition} alt="Test image" className="img-responsive"  />
      </header>
    </div>
  );
}

export default App;
